//npm start
import React from 'react';
//import img_main from '../../images/img_main.jpg';
import './MyPost.module.css';

const MyPost = () => {
    return (
        <React.Fragment>
            <section className='mypost'>
                <article>
                <textarea></textarea>
                <button></button>
                </article>
            </section>

        </React.Fragment>
    );
}

export default MyPost;
